val uis = sqlContext.read.json("s3://userinteractionmessages/raw/prod/2016/10/10/00/00-ip-10-0-*")

uis.registerTempTable("uis")
//uis.printSchema()

var query = "SELECT pageInfo.pageName, entity.checkout.orderNumber, entity.checkout.itineraryNumber, entity.checkout.trl  FROM uis "
query += "WHERE "
//query += "entity.checkout.orderNumber != '' "
