// gbv, netvalue, taxes
val uis = sqlContext.read.json("s3://userinteractionmessages/raw/prod/2016/12/05/00/03-ip-10-0-*")
uis.registerTempTable("uis")

var query = "SELECT pageInfo.pageName, entity.checkout.cartTotal.currency, entity.checkout.cartTotal.amount, entity.checkout.cartTotal.decimalAmountString, entity.checkout.cartTotal.taxesAndFees, entity.checkout.cartTotal.netValue, entity.checkout.cartTotal.taxes, entity.checkout.cartTotal.fees"
query += " FROM uis"
query += " WHERE"
query += " LCASE(pageInfo.pageName) LIKE '%page.checkout.confirmation'"

println(s"Query: $query")
var results = sqlContext.sql(query)
val fmt:java.lang.String = "%-50s %-10s %-12s %-12s %-12s %-10s %-10s %-10s"
println(String.format(fmt, "Page Name                                         ", "currency", "amount", "amountText", "taxesAndFees", "netValue  ", "taxes     ", "fees      "))
println(String.format(fmt, "--------------------------------------------------", "--------", "------", "----------", "------------", "----------", "----------", "----------"))
results.collect.foreach(r => {
  val pageName = r.getString(0)
  val currency = r.getString(1)
  var amount = "null"
  if (!r.isNullAt(2)) {
    amount = r.getDouble(2).toString;
  }
  val amountText = r.getString(3)
  val taxesAndFees = r.getString(4)
  var netValue = r.getString(5)
  var taxes = r.getString(6)
  var fees = r.getString(7)
  println(String.format(fmt, pageName, currency, amount, amountText, taxesAndFees, netValue, taxes, fees))
})

// Travel Pixel Web

val s3 = sqlContext.read.json(
    sc.textFile("s3n://ewe-collector-data-prod/idmap/2016/12/08/22/*.gz")
        .filter(line => line.toLowerCase().contains("trivagouserid"))
)

s3.registerTempTable("idmap")
var query = "SELECT trivagoUserID, xdid FROM idmap"
var results = sqlContext.sql(query)
val fmt:java.lang.String = "%-20s %-50s"
//results.show()

results.collect.foreach(r => {
  val uid = r.getString(0)
  val xdid = r.getString(1)
  println(String.format(fmt, uid, xdid))
})

